import { motion } from "framer-motion";
import styled from "styled-components";
import HomeComponent from "../components/home.component";
import AuthorsOfTheMonth from "./authorsMonth";

const HomeLayoutStyle = styled(motion.div)``;

const HomeLayout = () => {
  return (
    <HomeLayoutStyle>
      <HomeComponent />
      <AuthorsOfTheMonth />
    </HomeLayoutStyle>
  );
};

export default HomeLayout;
